import React, { Component } from 'react'

export default class Login extends Component {
    render() {
        return (
            <div className="login-box">
                <div className="qrcode">
                    <img className="img" src="https://login.weixin.qq.com/qrcode/QYZ4GKOUcg==" alt="二维码" />
                    <div className="">
                        <p className="sub-title">使用手机微信扫码登录</p>
                        <p className="sub-desc">网页版需要配合手机使用</p>
                    </div>
                </div>

            </div>
        )
    }
}
